(38, '常见问题', '', '', 1461743608, 1461743608, -1, 0, '常见问题', '<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">根据第三方市场研究公司艾瑞咨询的数据，京东（JD.com）是中国最大的自营式电商企业，2015年第一季度在中国自营式B2C电商市场的占有率为56.3%。2014年，京东市场交易额达到2602亿元，净收入达到1150亿元。2015年第二季度，京东市场交易额达到1145亿元，同比增长82%；净收入达到459亿元，同比增长61%。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">目前，京东集团旗下设有京东商城、京东金融、拍拍、京东智能、京东到家及海外事业部。2014年5月，京东在美国纳斯达克证券交易所正式挂牌上市，是中国第一个成功赴美上市的大型综合型电商平台，并跻身全球前十大互联网公司排行榜。2015年7月，京东因其高成长性入选纳斯达克100指数和纳斯达克100平均加权指数，成为纳斯达克100指数中仅有的2家中国互联网公司之一。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东致力于为消费者提供愉悦的在线购物体验。通过内容丰富、人性化的网站（www.jd.com）和移动客户端，京东以富有竞争力的价格，提供具有丰富品类及卓越品质的商品和服务，以快速可靠的方式送达消费者，并且提供灵活多样的支付方式。另外，京东还为第三方卖家提供在线销售平台和物流等一系列增值服务。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东提供丰富优质的商品，品类包括：计算机、手机及其它数码产品、家电、汽车配件、服装与鞋类、奢侈品（如：手提包、手表与珠宝）、家居与家庭用品、化妆品与其它个人护理用品、食品与营养品、书籍、电子图书、音乐、电影与其它媒体产品、母婴用品与玩具、体育与健身器材以及虚拟商品（如：国内机票、酒店预订等）。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东拥有中国电商行业最大的仓储设施。截至2015年6月30日，京东在全国拥有7大物流中心，在全国44座城市运营166个大型仓库，拥有4142个配送站和自提点，覆盖全国2043个区县。京东专业的配送队伍能够为消费者提供一系列专业服务，如：211限时达、次日达、夜间配和三小时极速达，GIS包裹实时追踪、售后100分、快速退换货以及家电上门安装等服务，保障用户享受到卓越、全面的物流配送和完整的“端对端”购物体验。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东是一家技术驱动的公司，从成立伊始就投入巨资开发完善可靠、能够不断升级、以电商应用服务为核心的自有技术平台。我们将继续增强公司的技术平台实力，以便更好地提升内部运营效率，同时为合作伙伴提供卓越服务。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">配送服务说明：</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">211限时达：当日上午11：00前提交的现货订单（部分城市为上午10点前），以订单出库完成拣货时间点开始计算，当日送达；夜里11：00前提交的现货订单（以订单出库后完成拣货时间点开始计算），次日15：00前送达。截至2015年7月31日，“211限时达”已覆盖全国135个区县。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">次日达：在一定时间点之前提交的现货订单（以订单出库后完成拣货的时间点开始计算），将于次日送达。截至2015年7月31日，“次日达”已覆盖全国951个区县。 极速达：京东为消费者提供的一项个性化付费增值服务。 消费者通过“在线支付”方式全额成功付款或“货到付款”方式成功提交订单，并勾选“极速达”服务后，京东会在服务时间内，3小时将商品送至消费者所留地址。目前，“极速达”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">夜间配：京东为消费者提供更快速、更便利的一项增值服务。消费者下单时在日历中选择“19:00-22:00”时段，属“夜间配”服务范围内的商品，京东会尽可能安排配送员在消费者选定当日晚间19:00-22:00送货上门。目前，“夜间配”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。211限时达：当日上午11：00前提交的现货订单（部分城市为上午10点前），以订单出库完成拣货时间点开始计算，当日送达；夜里11：00前提交的现货订单（以订单出库后完成拣货时间点开始计算），次日15：00前送达。截至2015年7月31日，“211限时达”已覆盖全国135个区县。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">次日达：在一定时间点之前提交的现货订单（以订单出库后完成拣货的时间点开始计算），将于次日送达。截至2015年7月31日，“次日达”已覆盖全国951个区县。 极速达：京东为消费者提供的一项个性化付费增值服务。 消费者通过“在线支付”方式全额成功付款或“货到付款”方式成功提交订单，并勾选“极速达”服务后，京东会在服务时间内，3小时将商品送至消费者所留地址。目前，“极速达”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">夜间配：京东为消费者提供更快速、更便利的一项增值服务。消费者下单时在日历中选择“19:00-22:00”时段，属“夜间配”服务范围内的商品，京东会尽可能安排配送员在消费者选定当日晚间19:00-22:00送货上门。目前，“夜间配”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。</span>', 0, 0, 17, '201', 0, 1, ''),
(39, '购物指南', '', '', 1461743608, 1461743608, -1, 0, '购物指南', '<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">根据第三方市场研究公司艾瑞咨询的数据，京东（JD.com）是中国最大的自营式电商企业，2015年第一季度在中国自营式B2C电商市场的占有率为56.3%。2014年，京东市场交易额达到2602亿元，净收入达到1150亿元。2015年第二季度，京东市场交易额达到1145亿元，同比增长82%；净收入达到459亿元，同比增长61%。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">目前，京东集团旗下设有京东商城、京东金融、拍拍、京东智能、京东到家及海外事业部。2014年5月，京东在美国纳斯达克证券交易所正式挂牌上市，是中国第一个成功赴美上市的大型综合型电商平台，并跻身全球前十大互联网公司排行榜。2015年7月，京东因其高成长性入选纳斯达克100指数和纳斯达克100平均加权指数，成为纳斯达克100指数中仅有的2家中国互联网公司之一。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东致力于为消费者提供愉悦的在线购物体验。通过内容丰富、人性化的网站（www.jd.com）和移动客户端，京东以富有竞争力的价格，提供具有丰富品类及卓越品质的商品和服务，以快速可靠的方式送达消费者，并且提供灵活多样的支付方式。另外，京东还为第三方卖家提供在线销售平台和物流等一系列增值服务。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东提供丰富优质的商品，品类包括：计算机、手机及其它数码产品、家电、汽车配件、服装与鞋类、奢侈品（如：手提包、手表与珠宝）、家居与家庭用品、化妆品与其它个人护理用品、食品与营养品、书籍、电子图书、音乐、电影与其它媒体产品、母婴用品与玩具、体育与健身器材以及虚拟商品（如：国内机票、酒店预订等）。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东拥有中国电商行业最大的仓储设施。截至2015年6月30日，京东在全国拥有7大物流中心，在全国44座城市运营166个大型仓库，拥有4142个配送站和自提点，覆盖全国2043个区县。京东专业的配送队伍能够为消费者提供一系列专业服务，如：211限时达、次日达、夜间配和三小时极速达，GIS包裹实时追踪、售后100分、快速退换货以及家电上门安装等服务，保障用户享受到卓越、全面的物流配送和完整的“端对端”购物体验。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">京东是一家技术驱动的公司，从成立伊始就投入巨资开发完善可靠、能够不断升级、以电商应用服务为核心的自有技术平台。我们将继续增强公司的技术平台实力，以便更好地提升内部运营效率，同时为合作伙伴提供卓越服务。</span><br />\r\n<br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">配送服务说明：</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">211限时达：当日上午11：00前提交的现货订单（部分城市为上午10点前），以订单出库完成拣货时间点开始计算，当日送达；夜里11：00前提交的现货订单（以订单出库后完成拣货时间点开始计算），次日15：00前送达。截至2015年7月31日，“211限时达”已覆盖全国135个区县。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">次日达：在一定时间点之前提交的现货订单（以订单出库后完成拣货的时间点开始计算），将于次日送达。截至2015年7月31日，“次日达”已覆盖全国951个区县。 极速达：京东为消费者提供的一项个性化付费增值服务。 消费者通过“在线支付”方式全额成功付款或“货到付款”方式成功提交订单，并勾选“极速达”服务后，京东会在服务时间内，3小时将商品送至消费者所留地址。目前，“极速达”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">夜间配：京东为消费者提供更快速、更便利的一项增值服务。消费者下单时在日历中选择“19:00-22:00”时段，属“夜间配”服务范围内的商品，京东会尽可能安排配送员在消费者选定当日晚间19:00-22:00送货上门。目前，“夜间配”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。211限时达：当日上午11：00前提交的现货订单（部分城市为上午10点前），以订单出库完成拣货时间点开始计算，当日送达；夜里11：00前提交的现货订单（以订单出库后完成拣货时间点开始计算），次日15：00前送达。截至2015年7月31日，“211限时达”已覆盖全国135个区县。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">次日达：在一定时间点之前提交的现货订单（以订单出库后完成拣货的时间点开始计算），将于次日送达。截至2015年7月31日，“次日达”已覆盖全国951个区县。 极速达：京东为消费者提供的一项个性化付费增值服务。 消费者通过“在线支付”方式全额成功付款或“货到付款”方式成功提交订单，并勾选“极速达”服务后，京东会在服务时间内，3小时将商品送至消费者所留地址。目前，“极速达”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。</span><br />\r\n<span style="color:#5A5A5A;font-family:微软雅黑;line-height:30px;background-color:#FFFFFF;">夜间配：京东为消费者提供更快速、更便利的一项增值服务。消费者下单时在日历中选择“19:00-22:00”时段，属“夜间配”服务范围内的商品，京东会尽可能安排配送员在消费者选定当日晚间19:00-22:00送货上门。目前，“夜间配”业务在北京、上海、广州、成都、武汉、沈阳六个城市提供服务。</span>', 0, 0, 17, '201', 0, 1, ''),
