(45, '魅族年度新品晒单送公仔', '', '', 1462420179, 1461743580, 1, 0, '魅族年度新品晒单送公仔', '<span style="color:#666666;font-family:微软雅黑;font-size:14px;line-height:28px;background-color:#FFFFFF;">4月6日下午，在魅族新品发布会上又推出了一款音乐耳机——魅族EP51蓝牙运动耳机。</span><br />\r\n<span style="color:#666666;font-family:微软雅黑;font-size:14px;line-height:28px;background-color:#FFFFFF;">作为MP3起家又宣称回归音乐的魅族，这次重磅推出首款蓝牙运动耳机，无论是态度还是品质方面都应该值得期待和肯定。现在预约已上线，首发晒单赢公仔，期待11号10点首发！</span>', 0, 0, 17, '201', 0, 1, ''),
(46, '魅蓝note3火热抢购 低至799', '', '', 1462420144, 1462257120, 1, 0, '魅蓝note3火热抢购 低至799', '<p style="color:#666666;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	4月11日10:00，魅蓝note3京东首发，火热抢购，低至799元。9：30，京东APP，微信购物，手Q购物提前抢购，魅蓝note3配备5.5英寸全高清屏幕、2.5D玻璃、指纹识别、采用金属机身并支持全网通、指纹识别。值得一提的是，此次魅蓝note 3搭载了4100mAh电池，待机时间可达16天，可以观看17小时的视频，连续通话时间32小时。据专业机构评测结果显示：对魅蓝note 3进行5小时续航测试，其剩余电量达到了65%，排名第一。\r\n</p>\r\n<p style="color:#666666;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	4月18日10点，魅蓝note3开启第二轮抢购，移动端9:30提前抢。\r\n</p>\r\n<p style="color:#666666;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<br />\r\n</p>', 0, 0, 17, '201', 0, 1, ''),
(47, '下单立减200再抢神券！得力助力“营改增”', '', '', 1462420115, 1462257120, 1, 0, '下单立减200再抢神券！得力助力“营改增”', '<span style="color:#666666;font-family:微软雅黑;font-size:14px;line-height:28px;background-color:#FFFFFF;">5</span><span style="color:#666666;font-family:微软雅黑;font-size:14px;line-height:28px;background-color:#FFFFFF;">月</span><span style="color:#666666;font-family:微软雅黑;font-size:14px;line-height:28px;background-color:#FFFFFF;">1</span><span style="color:#666666;font-family:微软雅黑;font-size:14px;line-height:28px;background-color:#FFFFFF;">日“营改增”来袭，您准备好了么？得力办公助力“营改增”打印机、打印纸一步到位！猛戳：</span>', 0, 0, 17, '201', 0, 1, ''),
(48, '魅蓝note3每周一10:00点抢购', '', '', 1462420063, 1462257120, 1, 0, '魅蓝note3每周一10:00点抢购', '魅蓝note3每周一10:00点抢购！购魅族PRO5享12期免息，0利息0首付，月供低至¥234元/起！魅蓝metal低至¥999现货不用抢！活动链', 0, 0, 17, '201', 0, 1, ''),
(49, '蝴蝶节化蝶盛典发布潮流风尚', '', '', 1462419994, 1462347780, 1, 0, '蝴蝶节化蝶盛典发布潮流风尚', '<p style="color:#666666;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	亲爱的各位网友：\r\n</p>\r\n<p style="color:#666666;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<br />\r\n2月24日晚，蝴蝶节化蝶盛典暨2016潮流风尚发布会在北京·国贸三期隆重举行。京东商城CEO沈皓瑜、京东商城消费品事业部总裁冯轶与国内外品牌商代表以及品牌代言明星，共同开启了2016年京东蝴蝶节。此次，京东还携手东田造型共同发布了2016年“蝴蝶节”潮流风尚趋势并上演「蝶•变」系列主题秀，为京东蝴蝶节增添了时尚色彩。\r\n</p>\r\n<p style="color:#666666;font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;">\r\n	<br />\r\n京东商城CEO沈皓瑜表示：蝴蝶节是为消费者打造专属于美妆、个护品类的购物狂欢节，同时，京东也非常愿意与各位伙伴紧密合作，共同推动美妆与个护品类电商市场的发展繁荣。\r\n</p>', 0, 0, 17, '201', 0, 1, '');
