(237, 'zfb', '在线支付', 368, 0, 10, '', '', '', '', '', '', '', '', '', '', 0, 2, 1, 0, 0, '', '""', 1461515539, 1462417304, 1, 0, 2, '<p class="fw">\r\n	1、在线支付平台\r\n</p>\r\n<p>\r\n	商城提供支付宝、财付通、微信支付、银联在线支付等4种在线支付平台支付，同时酒仙网还支持中国工商银行交通银行、中国建设银行、招商银行、中国银行、中国银行、中国民生银行、中信银行、北京银行、浦发银行、广发银行、兴业银行、中国邮政储蓄银行、中国光大银行、平安银行等15家银行的网银在线支付。选择在线支付，即时到帐，准确快捷！\r\n</p>\r\n&nbsp;\r\n<p class="fw">\r\n	2、银行卡的开通\r\n</p>\r\n<p>\r\n	因各地银行政策不同，建议您在网上支付前拨打所在地银行电话，咨询该行可供网上支付的银行卡种类及开通手续。\r\n</p>\r\n&nbsp;\r\n<p class="fw">\r\n	3、支付金额上限\r\n</p>\r\n<p>\r\n	目前各银行对于网上支付均有一定金额的限制，由于各银行政策不同，建议您在申请网上支付功能时向银行咨询相关事宜。\r\n</p>\r\n&nbsp;\r\n<p class="fw">\r\n	4、到款时间\r\n</p>\r\n<p>\r\n	网上支付均是支付成功即到账。若由于网络故障导致您已支付成功的订单未改变订单状态，请您联系我们的客服人员为您解决 客服热线：400-963-0118（仅收市话费）\r\n</p>\r\n&nbsp;\r\n<p class="fw">\r\n	温馨提示：\r\n</p>\r\n<p>\r\n	若您订单中商品在当地仓储中心无货，系统会将自动订单拆分至有货的仓储中心。您需一次性支持全部的货款，用礼品卡、红包、账户余额、返现等虚拟账户支付的部分、将按照拆分订单金额比例分配至子订单。在线支付付款等待期限为24小时。请您在订购成功后24小时内完成支付，否则我们将不会保留您的订单。\r\n</p>'),
(238, 'kjzf', '线下汇款', 368, 0, 10, '', '', '', '', '', '', '', '', '', '', 0, 2, 1, 0, 0, '', '""', 1461515553, 1462417379, 1, 0, 2, '<p>\r\n	为了方便顾客够买产品，特设立中国银行帐户，在您汇款至公司帐户后，请及时通知我们，便于及时发货。\r\n</p>\r\n<p>\r\n	开户行：中国银行股份有限公司北京中银大厦支行\r\n</p>\r\n<p>\r\n	账&nbsp; 号：6228 **** **** **** 175\r\n</p>\r\n<p>\r\n	公&nbsp; 司：一网电子商务股份有限公司\r\n</p>\r\n&nbsp;\r\n<p>\r\n	温馨提示：\r\n</p>\r\n<p>\r\n	请在汇款单的附言处注明订单号和用户名（非常重要！）；\r\n</p>'),
