(378, 'gsjs', '公司介绍', 371, 0, 10, '', '', '', '', '', '', '', '', '', '', 0, 2, 1, 0, 0, '', '""', 1462417864, 1462417864, 1, 0, 2, '<p>\r\n	一网电商（公司原名称为北京一网天行科技有限公司，简称“一网电商”），是目前中国电子商务综合服务公司，主要从事百货商品的线上零售，同时为企业提供电子商务综合服务，经营范围包括各类百货等。\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	<span>一网电商</span>总部位于北京，在上海、广州、天津、武汉、成都等地拥有子公司和运营中心，同时，沈阳运营中心正在筹建中。公司借助现代电子商务平台进行全品类产品及相关消费品的销售服务，除了做好线上零售之外，还逐步整合行业上下游资源，为企业提供电子商务领域的综合服务。\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	经过近年来的高速发展，<span>一网电商</span>赢得众多专业投资机构的青睐，截至2014年4月，相继获得机构和部分个人投资者五轮共计6.3亿元的投资。\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	<span>一网电商</span>遵循“质真价优、快速便捷”的经营宗旨，为消费者提供有保证、性价比高、配送快捷的精准服务，充分满足消费者个性化需求，彰显消费者品位生活特质。<span>一网电商</span>以诚信为本，视品牌如生命，凭借十多年的经营历程，忠实履行“买真货就上<span>一网电商</span>”的道德承诺。\r\n</p>\r\n<p>\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	<span>一网电商</span>全体员工秉承着“一群人，一辈子，只做一件事”的理念，专注于百货行业，积极寻求模式创新及管理突破，充分利用电子商务的无国界功能，为中国百货搭建平台，为百货融入中国创造条件，不断提升自身综合实力，为成为百货流通企业而努力奋斗。\r\n</p>'),
