INSERT INTO `ewshop_credits` (`id`, `title`, `thumb`, `content`, `pccontent`, `points`, `create_time`) VALUES
(1, '企业组织管控与执行力', '219', '<div class="article">\r\n	<h3>\r\n		礼品介绍\r\n	</h3>\r\n</div>\r\n<div class="artic">\r\n	<p>\r\n		孙子曰：兵无常势、水无常形，能因敌变化而取胜者，谓之神。\r\n	</p>\r\n	<p>\r\n		企业经营无一定之规，但必然有章可循。\r\n	</p>\r\n	<p>\r\n		现实中，企业与各级管理者往往面临三大难题：\r\n	</p>\r\n	<p>\r\n		1、四处救火、疲于奔命-----部门推诿扯皮，责任不能落地，不知如何提高下属执行力，企业略模糊、组织效率低下', '<h1>\r\n	【商品简介】\r\n</h1>\r\n<p>\r\n	一、传承：世界难题\r\n</p>\r\n<p>\r\n	1.家族企业、国有企业、王朝传承之痛\r\n</p>\r\n<p>\r\n	2.《家业传承中的领导学》：人生的必修课\r\n</p>\r\n<p>\r\n	3.传承的角色：开创者-协调者-后来者v\r\n</p>\r\n<p>\r\n	二、开创者的领导学\r\n</p>\r\n<p>\r\n	1.开创者的群体特质       2.开创者的内心世界\r\n</p>\r\n<p>\r\n	3.开创者的退休类型       4.开创者的自我认知\r\n</p>\r\n<p>\r\n', '1000', 1448848260),
