(106, '44.30', '<span style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;">　　</span><span style="color:#666666;font-size:14px;line-height:24px;font-family:宋体;background-color:#FFFFFF;">　　畅销10年<br />\r\n　　思想领导力奖获奖作品<br />\r\n　　实现无缝产品管理的指导精要<br />\r\n　　当前的经济社会中，产品复杂性不断增加，竞争不断加剧，消费者成熟度不断提高。在这种环境下，产品管理比以往任何时候都更为重要。作为产品经理，你始终处于产品成败的第一线。<br />\r\n　　《产品经理手册》是培养并无缝融合成功产品经理的各个关键方面，是学习产品和市场知识、财务及战略敏锐性以及人际技能等的资源。十多年来，本书一直在帮助产品经理提高自身实践的熟练程度，并且成为确保公司能长期盈利的重要贡献者。<br />\r\n　　《产品经理手册（原书第4版）》集合了成功的产品经理所需的新指导方法和各种见解。本次全面改版后，做了如下优化：<br />\r\n　　提供了大量流程图、路线图、模板、检查表和各种一览表。<br />\r\n　　提供了大量很有帮助的在线视频和资源。<br />\r\n　　提供了很多判断题和思考题。<br />\r\n　　《产品经理手册》为你提供了实用的模板，用来创造优质的产品和服务，为公司带来长期的价值</span><strong><span style="font-family:宋体;">。</span></strong>', '中国大陆', 9999, '', '809', '', ''),
(107, '33.60', '<p>\r\n	<span style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;">　　精彩的人生由无数个大大小小的决策过程所组成。从事什么样的工作，怎样打理一宗生意，该和谁结婚，怎样将孩子抚养成人，要不要竞争总裁的位置，都是这类决策的例子。虽然冲突的成分很多，但是合作的因素也不少。《策略思维》将帮助你学会策略地思考，在人生博弈中扩大胜面。</span><br />\r\n<span style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;">　　《双赢之道》将新颖优越的方案展献给读者并有助于在谈判中达成共识。它教你学会争端解决程序，它可以使你做到：公平而富有效率地分割一组有争议的财产；无须耗时的争论和昂贵的诉讼即可解决争端；消除输给一个更善于谈判的对手的危险；感觉你获得了总价值中的大部分（对不起，你的对手也是这样感觉)。&nbsp;</span>\r\n</p>\r\n<p>\r\n	<span style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;">\r\n	<p style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;background-color:#FFFFFF;">\r\n		　　耶鲁大学教授奈尔伯夫和普林斯顿大学教授迪克西特的这本著作，用许多活生生的例子，向没有经济学基础的读者展示了博弈论策略思维的道理。试看一例：\r\n	</p>\r\n	<p style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;background-color:#FFFFFF;">\r\n		　　奈尔伯夫大学毕业的时候，在剑桥大学的正式舞会上参加轮盘赌游戏并且以700：300的大比数领先。眼看大奖在望，鬼使神差他却无视已经具有的后动优势，在最后一轮大意先行，结果功败垂成。事后他回忆那天酒喝多了，忘记了博弈论的教导：领先的时候要采取让对手先行的保守策略。这位博弈论的高才生，就这样输在原来处于第二位并且曾经求和建议分享奖励的女士手下（参见《策略思维：商界、政界及日常生活中的策略竞争》第1章）。\r\n	</p>\r\n	<p style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;background-color:#FFFFFF;">\r\n		　　人生是一个永不停息的决策过程。从事什么样的工作，怎样打理一宗生意，该和谁结婚，怎样将孩子抚养成人，要不要竞争总裁的位置，都是这类决策的例子。你不是在一个真空的世界里做决定。相反，你身边全是和你一样的决策制定者。虽然冲突的成分很多，但是合作的因素也不少。《策略思维：商界、政界及日常生活中的策略竞争》将帮助你学会策略地思考，在人生博弈中扩大胜面。\r\n	</p>\r\n	<p style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;background-color:#FFFFFF;">\r\n		　　《策略思维：商界、政界及日常生活中的策略竞争》以讲故事取胜。它的学术根源，是迪克西特教授在普林斯顿大学公共与国际事务学院开设的“策略博弈”课程。简而言之，这是关于了解对手打算如何战胜你，然后你战而胜之的艺术。怎样打赢一场网球，少数如何战胜多数，为什么要“喜爱”你讨厌的对手等等，都在讨论之列。\r\n	</p>\r\n	<p style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;background-color:#FFFFFF;">\r\n		　　这是一门新兴的策略科学，由一些简单的基本原理组成。不同背景和行业的读者掌握了这些原理，运筹帷幄取得胜利的本领就会上升一个层次。\r\n	</p>\r\n	<div>\r\n		<br />\r\n	</div>\r\n<br />\r\n</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '中国大陆', 9999, '', '800,801,802', '', ''),
