(359, '46.50', '<p style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;background-color:#FFFFFF;">\r\n	　　1. 《MBA十日读》自1993年出版以来，稳占美国畅销书市场一席之地，被译为7种文字。英文原版累计销售40万余册，中文版突破10万册。\r\n</p>\r\n<p style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;background-color:#FFFFFF;">\r\n	　　2. 获1997年/2001年/2002年中国优秀畅销书奖。<br />\r\n　　3. 一本书涵盖美国著名商学院受欢迎的MBA课程精华。<br />\r\n　　4. 一本书帮助读者掌握基础知识，磨练商业敏锐感；造就MBA思维，提升个人核心竞争力。<br />\r\n　　5.提供美国各大媒体近期MBA商学院排行，为就读国外MBA读者提供索引资料。<br />\r\n　　6.为就读MBA提供入门级阅读材料。\r\n</p>', '中国大陆', 10, '', '817,818', '', ''),
