(361, '21.70', '<span style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;">　　第一章反身性理论反均衡经济理论致力于研究均衡点。均衡概念是非常有用的，它容许我们将注意力集中于最终的结果而不必考虑形成这一结果的过程。但同时这也是一个很迷惑人的概念，颇有经验主义的气味。既然经过调整过程可以实现均衡，则该均衡点必定是以某种形式可观察到的。真实情况却并非如此，现实生活中几乎看不到均衡——市场价格的灵活易变是尽人皆知的，所观察到的过程只不过被人为地设定为趋于均衡，可为什么永远也达不到均衡呢？不错，市场参与者必须顺应市场价格，可他们所顺应的也许是一个不断游移的目标，这样一来，根本就谈不到什么顺应，而经济学的所谓均衡也只不过是天方夜谭。</span><br />\r\n<span style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;">　　均衡观念是公理系统的产物。经济理论的结构类似于逻辑学或数学，它建立在某些公设的基础之上，所有的结论都经过逻辑推理以公设为前提推导而来。均衡的非现实性无损于逻辑结构的有效性，但是，如果将假设的均衡看成现实的模型就会出现严重的失真，正如应用欧氏几何描述三角形内角之和不等于180度的空间时将会发生的情形。</span><br />\r\n<span style="color:#666666;font-family:Arial, Verdana, 宋体;font-size:14px;line-height:24px;background-color:#FFFFFF;">　　公理化方法的最高成就是充分竞争理论。尽管这一理论已经有200年的历史，但至今未被超越，只是分析的方法做了改进。</span>', '中国大陆', 10, '', '825', '', ''),
